import { apiURL } from "../utils/Global";

export const getRecords = async() => {

    const response = await fetch(`${apiURL}/record`, {

        method:"GET",
        headers:{
            'Content-Type': 'application/json',
            'Access-Control-Allow-Origin': '*',
            'Access-Control-Allow-Credentials': true,
        }

    });

    return response;

}
